@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:CashCard a owl:Class .
:Bank a owl:Class .

:issuesCard a owl:ObjectProperty ;
  rdfs:domain :Bank ;
  rdfs:range :CashCard .

:bankCode a owl:DatatypeProperty ;
  rdfs:domain :CashCard ;
  rdfs:range xsd:string .

:validBankCode a owl:DatatypeProperty ;
  rdfs:domain :CashCard ;
  rdfs:range xsd:boolean .

# A bank code is valid if the cash card was issued by the bank.
[ a owl:Axiom ;
  rdfs:comment "A bank code is valid if the cash card was issued by the bank." ;
  owl:annotatedSource :CashCard ;
  owl:annotatedProperty :validBankCode ;
  owl:annotatedTarget true ;
  owl:hasValue true ;
  owl:qualifiedCardinality 1 ;
  owl:onProperty :issuesCard ;
  owl:someValuesFrom :Bank
] .
